// Helper to get a specific maze
function getMaze(size, index = 0) {
  if (MAZE_DATA[size] && MAZE_DATA[size][index]) {
    return MAZE_DATA[size][index];
  }
  return null;
}

// Get all mazes for a specific size
function getMazesForSize(size) {
  return MAZE_DATA[size] || [];
}

// Get total number of mazes
function getTotalMazeCount() {
  let count = 0;
  for (const size in MAZE_DATA) {
    count += MAZE_DATA[size].length;
  }
  return count;
}
